import React  from "react"
import "./table.css"


const Table = (props) => {
    const key1 = (props.title === "Education")? "Company": "Institute";
    const key2 = (props.title === "Education")? "Level": "Designation";
    return (<div id={props.title}>
        <h1>          
            <i className={props.icon} />
            {props.title} 
        </h1>
        <table>
            <tbody>
            {
                props.details.map((row, pos) => <>
                <tr>
                    <td> {pos+1}       </td>
                    <td> {row[key1]}  
                        <a className="date"> ({row.Date})  </a>
                    </td>
                    <td> {row[key2]} </td>
                    <ul>
                        {row.Projects.map(project => <li> {project} </li>)}
                    </ul>
                </tr>

            </>)
            }
            </tbody>
        </table>
    </div>)
}



export  default Table;
